import React from 'react';
import HomeImage from '../images/Home.png';
import SearchImage from '../images/Search.png';

export const Home = () => {
  return (
    <div className='row'>
      <div className='column'>
        <img src={HomeImage} />
        <img src={SearchImage} />
      </div>
    </div>
  )
}
